oxy_webhelp_navlinks = {"operation-d734e176":{"topics":[{"title":"Starting and stopping the charging process","shortdesc":"<p class=\"shortdesc\">To start the charging process, connect the charging cable to your electric vehicle and press the start button on the EV-Charger.<\/p>","href":"topics\/starting_and_stopping_the_charging_process.html","attributes":{"data-id":"starting-and-stopping-the-charging-process"},"menu":{"hasChildren":false},"tocID":"starting-and-stopping-the-charging-process-d734e187","topics":[]},{"title":"Using the display and controls","shortdesc":"<p class=\"shortdesc\">The display screen on the EV-Charger shows the charging status, estimated time to full charge, and any error messages. The controls on the EV-Charger allow you to start and stop the charging process, adjust the charging rate, and set a timer for charging.<\/p>","href":"topics\/using_the_display_and_controls.html","attributes":{"data-id":"using-the-display-and-controls"},"menu":{"hasChildren":false},"tocID":"using-the-display-and-controls-d734e198","topics":[]},{"title":"Understanding the LED indicators","shortdesc":"<p class=\"shortdesc\">The EV-Charger has LED indicators that show the charging status and any error messages. A green light indicates that the charging process is in progress, while a red light indicates an error.<\/p>","href":"topics\/understanding_the_led_indicators.html","attributes":{"data-id":"understanding-the-led-indicators"},"menu":{"hasChildren":false},"tocID":"understanding-the-led-indicators-d734e209","topics":[]},{"title":"Troubleshooting common issues","shortdesc":"<p class=\"shortdesc\">If you encounter any issues with the EV-Charger, consult the troubleshooting section of the user manual. Common issues include faulty wiring, incorrect installation, and overheating.<\/p>","href":"topics\/troubleshooting_common_issues.html","attributes":{"data-id":"troubleshooting-common-issues"},"menu":{"hasChildren":false},"tocID":"troubleshooting-common-issues-d734e220","topics":[]}]}};